import { Layout } from './Layout';
import { useAuth } from '../../../hooks/useAuth';

export const AddReview = ({ setShow, show, placeId }) => {
    const { token } = useAuth();
    const handleShow = () => {
        setShow(!show);
    }

    return <Layout show={show} handleShow={handleShow} />
}
